import React from "react";
import PropTypes from 'prop-types';

const Icon = ({ name, color, size }) => (
  <img src={"/static/icons/linkedin.svg"}/>
);

Icon.propTypes = {
  name: PropTypes.string.isRequired,
  color: PropTypes.string,
  size: PropTypes.number
};

export default Icon;
